import axios from "axios";
import authHeader from "./auth-header";
import { API_URL } from "./constants";

const getClients = () => {
  return axios
    .get(API_URL + "api/clients", { headers: authHeader() })
    .then((response) => {
        console.log(response.data);

      return response.data;
    });
};

const addClient = (data) => {
    return axios
      .post(API_URL + "api/clients",data ,
      {
        headers: authHeader()
      } )
      .then((response) => {
        return response.data;
      });
  };

const getClientById = (id) => {
    return axios
      .get(API_URL + "api/clients/{:id}", { headers: authHeader() })
      .then((response) => {
          console.log(response.data);

        return response.data;
      });
  };

export default {
  getClients,getClientById,addClient
};
